// src/App.js
import React from 'react';
import styled from 'styled-components';
import Calendar from './Calendar';
import Sidebar from './Sidebar';

const AppWrapper = styled.div`
  display: flex;
`;

const ContentWrapper = styled.div`
  display: flex;
  flex-direction: column;
  flex-grow: 1;
`;

const App = () => {
  return (
    <AppWrapper>



      <ContentWrapper>

        <Calendar />
        <Sidebar />
      </ContentWrapper>

    </AppWrapper>
  );
};

export default App;
